import axios from "axios";
const API_URL = "http://localhost:8080/wallets/";

const transfer = (senderUsername,username,transferAmount)=>{
    return axios.post(API_URL + `${senderUsername}/transfer`,{
        username,
        transferAmount
    });
};

const WalletService = {
    transfer
}
export default WalletService;
